import React from 'react';
import styled from 'styled-components';

const NowLogoutS = styled.div`
  cursor: pointer;
  text-align : center;
  line-height : 36px;
  width: ${(props) => props.width};
  height: 36px;
  font-size: 16px;
  font-family:'bitbit';
  font-weight: 1;
  margin-left: ${(props) => props.marginLeft};
  margin-right: ${(props) => props.marginRight};
  color: ${(props) => props.color};
`;

const BlockS = styled.div`
  text-align : center;
  line-height : 36px;
  width: ${(props) => props.width};
  height: 36px;
  font-size: 16px;
  font-family:'bitbit';
  font-weight: 1;
  margin-left: ${(props) => props.marginLeft};
  margin-right: ${(props) => props.marginRight};
  color: ${(props) => props.color};
`;

function NowLogout() {
  return <>
    <BlockS width='80px'>
      <NowLogoutS marginLeft="auto" color='rgb(0,0,0)'>마</NowLogoutS>
      <NowLogoutS color='rgb(50,50,50)'>이페이지</NowLogoutS>
    </BlockS>
    <NowLogoutS>좋아요</NowLogoutS>
    <NowLogoutS>장바구나</NowLogoutS>
    <NowLogoutS marginRight="50px">로그아웃</NowLogoutS>
  </>;
}

export default NowLogout;
